import React, { useState, useEffect } from 'react';
import { request } from '../axios_helper';
import FiltersForm from './FiltersForm';
import { exportToXML } from '../helpers/saveToXML';
const DataTable = () => {
    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [filters, setFilters] = useState({
        year: '',
        price: '',
        region: '',
        surface: '',
        type: '',
        before: '0',
        after: '0',
        sort: '',
        sortAsc: '',
        oneYear: '0'
    });
    const wojewodztwa = [
        'DOLNOŚLĄSKIE', 'KUJAWSKO-POMORSKIE', 'LUBELSKIE', 'LUBUSKIE', 
        'ŁÓDZKIE', 'MAŁOPOLSKIE', 'MAZOWIECKIE', 'OPOLSKIE', 
        'PODKARPACKIE', 'PODLASKIE', 'POMORSKIE', 'ŚLĄSKIE', 
        'ŚWIĘTOKRZYSKIE', 'WARMIŃSKO-MAZURSKIE', 'WIELKOPOLSKIE', 'ZACHODNIOPOMORSKIE'
    ];

    const lata = Array.from({ length: 2022 - 2012 + 1 }, (_, i) => 2012 + i);

    const powierzchnie = [
        'do 40 m2', 'od 40,1 do 60 m2', 'od 60,1 do 80 m2', 'od 80,1 m2'
    ];
    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = () => {
        console.log(filters);
        const queryParams = new URLSearchParams();
        Object.keys(filters).forEach(key => {
            if (filters[key]) {
                queryParams.append(key, filters[key]);
            }
        });
        request('GET', `/api/prices?${queryParams}`)
            .then(response => {
                console.log('Response data:', response.data); 
                setData(response.data);
                setLoading(false);
            })
            .catch(error => {
                console.log('Error:', error);
                setError(error.message);
                setLoading(false);
            });
    };

    const handleFilterChange = (event) => {
        const { name, value } = event.target;
        setFilters({ ...filters, [name]: value });
    };

    const handleRadioChange = (event) => {
        const { name, value } = event.target;
        setFilters({ ...filters, [name]: value, before: '0', oneYear: '0', [name]: value });
    };

    const handleRadioClick = (event) => {
        const { name } = event.target;
        if (filters[name]) {
            setFilters({ ...filters, [name]: '' });
        }
    };
    const handleFilterSubmit = (event) => {
        event.preventDefault();
        setLoading(true);
        fetchData();
    };

    const handleExportToXML = () => {
        exportToXML(data, 'filtered_data'); 
    };


    if (loading) {
        return <div>Ładowanie danych...</div>;
    }

    if (error) {
        return <div>Błąd: {error}</div>;
    }

    return (
        <div>

            <FiltersForm
                filters={filters}
                handleFilterChange={handleFilterChange}
                handleFilterSubmit={handleFilterSubmit}
                handleRadioChange={handleRadioChange}
                handleRadioClick={handleRadioClick}
                wojewodztwa={wojewodztwa}
                powierzchnie={powierzchnie}
                lata={lata}
            />
            <button onClick={handleExportToXML}>Pobierz dane XML</button>

            <div className="container">
                <table className="table">
                    <thead>
                        <tr>
                            <th>Region</th>
                            <th>Kwartał</th>
                            <th>Typ mieszkania</th>
                            <th>Powierzchnia</th>
                            <th>Rok</th>
                            <th>Średnia cena</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map(item => (
                            <tr key={`${item.id}`}>
                                <td>{item.region}</td>
                                <td>{item.quarter}</td>
                                <td>{item.type}</td>
                                <td>{item.surface}</td>
                                <td>{item.year}</td>
                                <td>{item.price}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default DataTable;
